const string_to_list = (string, type) =>{
    try{
    const res = string.split("*");
    res.pop()
    if (type === 'float'){
        var num_list = []
        for (i=0; i<res.length; i++){
            const num = parseFloat(res[i])
            num_list.push(num)
        }
        console.log(num_list)
        return num_list
    } else{
        console.log(res)
        return res
    }
    } catch(error){
        console.log("string is ", string)
    }

    //

}

